import React, { useEffect, useState } from "react";
import RoleItem from "../../components/RoleItem/RoleItem";
import { URL_GOOGLE_SHEETS } from "../../constants";

const RolezandoList = () => {
  const [list, setList] = useState([]);
  const [hasError, setHasError] = useState(false);

  const getData = () => fetch(URL_GOOGLE_SHEETS).then((res) => res.text());

  useEffect(() => {
    const data = getData();

    console.log(data.then((result) => result));
  }, []);

  return (
    <>
      {list.map((item) => (
        <RoleItem data={item} />
      ))}
    </>
  );
};

export default RolezandoList;
